ero ideal para cada día. Es duradera, ligera y relativamente insensible al frío, calor u otras influencias externas.</li>\r\n 	<li>Correa de resina\r\nLa correa contiene resina sintética, un material ideal para este componente dada su extrema resistencia y su flexibilidad.</li>\r\n 	<li>Hebilla\r\nEl brazalete está equipado con una hebilla.</li>\r\n 	<li>7 años - 1 pila\r\nLa pila proporciona al reloj la energía necesaria durante aprox. 7 años</li>\r\n 	<li>Clasificación de resistencia al agua (WR) según ISO 22810\r\nEste modelo es resistente al agua según DIN 8310 o ISO 22810 y soporta pequeñas salpicaduras de agua. Deberá evitarse cualquier mayor contacto con el agua.</li>\r\n</ul>\r\n&nbsp;\r\n<ul>\r\n 	<li>Tamaño de la caja/peso total :\r\n<ul>\r\n 	<li>Tamaño de la caja : 38,20mm x 33,20mm x 8,50mm</li>\r\n 	<li>Peso total : 21g</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<strong>MODELO: F-91W-1D</strong>\r\n<strong>CODIGO: 31004</strong>'),('0385f5e6-31db-11ec-94ae-0242ac120003',NULL,'Cocina Aurora XLE.3',NULL,NULL,66500,0,0,1,1.21,'8a9d15e04f94ce8c6d60788b3acef98a.jpg','<ul>\r\n 	<li>Cubierta superior, frente perillas, respaldo y puerta parrilla de acero inoxidable.</li>\r\n 	<li>Laterales color negro.</li>\r\n 	<li>Quemadores de alta eﬁciencia.</li>\r\n 	<li>Válvula de seguridad en horno y hornallas.</li>\r\n 	<li>Horno y Parrilla recubierta con Easy Clean de fácil limpieza.</li>\r\n</ul>','cocina, Horno',0,'2021-10-20 19:22:06','2021-10-20 19:22:06',0,'53960bae-31d9-11ec-94ae-0242ac120003',NULL,'56792',0,0,'Todo lo que necesitas saber sobre este producto\r\n<ul>\r\n 	<li>Cubierta superior, frente perillas, respaldo y puerta parrilla de acero inoxidable.</li>\r\n 	<li>Laterales color negro.</li>\r\n 	<li>Quemadores de alta eﬁciencia.</li>\r\n 	<li>Válvula de seguridad en horno y hornallas.</li>\r\n 	<li>Horno y Parrilla recubierta con Easy Clean de fácil limpieza.</li>\r\n 	<li>Cajón parrilla deslizable.</li>\r\n 	<li>Encendido eléctrico a una mano.</li>\r\n 	<li>Med